import numpy as npimport pandas as pdimport matplotlib.pyplot as pltimport statsmodels.formula.api as smfdef Regress1(pairs, ETFs, UIs, plot=False):    Regression1, Resids1 = [], []     for i, pair in enumerate(pairs):                # Set up df with shifted diff        df = pair[["Return_x", "Return_y", "Diff"]]        df["_Diff"] = df["Diff"].shift(periods=1)                # Regress and append results        model1 = smf.ols(formula='Return_x ~ Return_y + _Diff', data=df, missing="drop").fit()        Regression1.append(model1)        Resids1.append(model1.resid)                print(model1.summary(yname=ETFs[i], xname=["Const", UIs[i],"Diff_lnP(t-1)"]))        print()                if plot:            plt.figure()            plt.plot(model1.resid)            plt.show();            return(Regression1, Resids1)    